import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import useCustomLogin from "../../hooks/useCustomLogin";
import { useEffect, useState } from "react";
import { weatherapi } from "../../api/openApi";

const switchFn = (category, obsrValue) => {
  let result = "";
  switch (category) {
    case category === "T1H":
      return (result += `기온 : ${obsrValue}`);

    case category === "PTY":
      return (result += `강수 : ${obsrValue}`);
    case category === "REH":
      return (result += `습도 : ${obsrValue}`);

    case category === "RN1":
      return (result += `강수량 : ${obsrValue}`);
    case category === "WSD":
      return (result += `풍속 : ${obsrValue}`);
    default:
      return;
  }
  return result;
};

const MainComponent = () => {
  const { loginState, isLogin } = useCustomLogin();
  console.log(isLogin);

  console.log(loginState); //user, accessToken 2개 들어있다 이렇게 슬라이스에보관

  //공공api
  const [weatherVisible, setWeatherVisible] = useState(false);
  const [weatherResult, setWeatherResult] = useState([]);

  useEffect(() => {
    const weatherapiEI = async () => {
      console.log("MainComponent.js weatherapiEI 내 weatherapi() 요청전 진입");
      const result = await weatherapi();
      if (Array.isArray(result)) {
        console.log("BasicMenu.js useEffect() 내 공공API 결과확인 ", result); //배열로받음
        let newObj = [];
        result.forEach((r) => {
          let newO = {};
          newO["category"] = r.category;
          newO["obsrValue"] = r.obsrValue;
          return newObj.push(newO);
        });
        console.log("BasicMenu.js useEffect() 배열로 category만 남김 ", newObj); //배열로 category만 남김
        //T1H; //기온 .PTY; //강수형태 REH; //습도 // 시간당 강수량 //풍속
        // let T1H = null; //기온
        // let PTY = resultArray.PTY; //강수형태
        // let REH = resultArray.REH; //습도
        // let RN1 = resultArray.RN1; // 시간당 강수량
        // let WSD = resultArray.WSD; //풍속

        // const total = {
        //   T1H,
        //   PTY,
        //   REH,
        //   RN1,
        //   WSD,
        // };
        setWeatherResult(() => {
          return newObj;
        });
        setWeatherVisible(() => true);
        console.log(
          "BasicMenu.js useEffect() weatehrReuslt => ",
          weatherResult
        );
      }
    };
    weatherapiEI();
  }, []);

  return (
    <>
      <Container>
        <br />
        <br />
        {isLogin && loginState ? (
          <>
            <h4> {loginState} 님의 하루관리</h4>
          </>
        ) : (
          <>
            <h4>하루관리</h4>
          </>
        )}
        {weatherVisible &&
          weatherResult.map((w, i) => {
            <>
              <span key={i}> {switchFn(w.category, w.obsrValue)}</span>;
            </>;
          })}

        <hr />
        <br />
      </Container>

      <Container style={{ textAlign: "center" }}>
        <Card style={{ width: "18rem", display: "inline-block" }}>
          <Card.Img
            variant="top"
            src="/img/oh.png"
            style={{
              display: "block",
              margin: "0 auto",
              width: "200px",
              height: "200px",
              objectFit: "contain",
            }}
          />
          <Card.Body>
            <Card.Title>사진다이어리</Card.Title>
            <Card.Text>내용</Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>내용</ListGroup.Item>
            <ListGroup.Item>내용</ListGroup.Item>
            <ListGroup.Item>내용</ListGroup.Item>
          </ListGroup>
          <Card.Body>
            <Card.Link href="#">수정/삭제</Card.Link>
            <Card.Link href="#">다이어리이동</Card.Link>
          </Card.Body>
        </Card>
        &nbsp; &nbsp;
        <Card style={{ width: "18rem", display: "inline-block" }}>
          <Card.Img
            variant="top"
            src="/smile.png"
            style={{
              display: "block",
              margin: "0 auto",
              width: "200px",
              height: "200px",
              objectFit: "contain",
            }}
          />
          <Card.Body>
            <Card.Title>식단</Card.Title>
            <Card.Text>식단</Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>아침</ListGroup.Item>
            <ListGroup.Item>점심</ListGroup.Item>
            <ListGroup.Item>저녁</ListGroup.Item>
          </ListGroup>
          <Card.Body>
            <Card.Link href="#">수정/삭제</Card.Link>
            <Card.Link href="#">식단관리이동</Card.Link>
          </Card.Body>
        </Card>
        &nbsp; &nbsp;
        <Card style={{ width: "18rem", display: "inline-block" }}>
          <Card.Img
            variant="top"
            src="/img/sunglass.png"
            style={{
              display: "block",
              margin: "0 auto",
              width: "200px",
              height: "200px",
              objectFit: "contain",
            }}
          />
          <Card.Body>
            <Card.Title>지출</Card.Title>
            <Card.Text>지출</Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>수입</ListGroup.Item>
            <ListGroup.Item>지출</ListGroup.Item>
            <ListGroup.Item>이달합계</ListGroup.Item>
